      \[

      \sin^3(x) \cos^2(x) = \sin(x) \cos^2(x) - \sin(x) \cos^4(x)

      \]


      So, the integral becomes:


      \[

      \int \sin(x) \cos^2(x) \, dx - \int \sin(x) \cos^4(x) \, dx

      \]


