      I notice that \(\sin(x)\) is the derivative of \(-\cos(x)\). This suggests that
      a substitution might be helpful. Let''s set:


      \[

      u = \cos(x) \quad \Rightarrow \quad du = -\sin(x) \, dx \quad \Rightarrow \quad
      -du = \sin(x) \, dx

      \]


